import React from "react";
import "./App.css";

function Home() {

  return (
    <>
    <h1>Just a little something to brighten your day!</h1>
    <p> Kayla is an amazing young woman who has an awesome personality and sense of humor, She is also absolutely beautiful. 
        You have many great goals set for yourself setting up great expectations for your future. Not only are thse great goals but they also involve helping other humas, just this alone shows me how much of a caring person you are.

    </p>


    </>
  );

  }
export default Home;
